request.description:
# Predicts target values for a set of features using a model
The prediction results returned by a model are dependent on the predictionDomain specified when the model was built.

# Classification models
When predicting using a classification model, the result returned from the model is the most likely class for each record. In order to include the model's scores for each class, specify the extraParameters.includeClassScores property set to true.

#  Anomalies models
When predicting using an anomaly detection model, the result returned from the model (in the anomaly column of each row) is negative if the row was identified as an outlier, and positive if the row was identified as "normal". The magnitude of the value provides a relative indicator of "how anomalous" or "how normal" the row is.

# Request URL
https://ml.nexosis.com/v1/models/{modelId}/predict

* modelID - Format - uuid. Model identifier of the Model to use for this prediction.

# Request Body
```json
